import React from 'react';
import './Navbar.css';
import { NavLink } from 'react-router-dom';

function Navbar() {
  return (
    <div className='nav__wrapper'>
      <div className='nav__container'>
        <div className='logo'></div>
        <div className='nav'>
          <NavLink to='/'>Home</NavLink>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
